import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="flex justify-between w-screen h-screen bg-gradient-to-r from-teal-200 via-indigo-100 to-lime-100">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
    </div>
  );
}

export default App;
